webpackJsonp([0x8de382d64a9d],{385:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Today we would like to announce that Early Bird ticket sales for PyCon APAC\nare now open.</p>\n<p>You can purchase your ticket here: <a href="https://www.eventnook.com/event/pyconapac2018">https://www.eventnook.com/event/pyconapac2018</a></p>\n<p>Please note that approved speakers and workshop conductors do not need to\npurchase tickets for themselves. We are still in the process of reviewing all\ntalk proposals, so if you submitted a proposal, please be patient. You don\'t\nhave to worry! In the unlikely event that we rejected your talk and Early Bird\nsales have ended, you will still get a ticket for the Early Bird rate!</p>\n<p>Everyone else, get your Early Bird ticket, while they last. Early Bird sales\nwill be available until April 15 or as long as stocks last.</p>',frontmatter:{date:"March 15, 2018",path:"/news/tickets",title:"Early Bird Ticket Sales Open Now!"}}},pathContext:{}}}});
